class Solution(object):
    def sumOfDistancesInTree(self, n, edges):
        """
        :type n: int
        :type edges: List[List[int]]
        :rtype: List[int]
        """
        # prepare
        from collections import defaultdict
        vertices = defaultdict(list)
        visited = [False] * n
        for edge in edges:
            vertices[edge[0]].append(edge[1])
            vertices[edge[1]].append(edge[0])

        subtrees = [0] * n
        distances = [0] * n

        def dfs(root):
            total_subtree = 0
            total_distance = 0
            has_children = False

            for vertex in vertices[root]:
                if not visited[vertex]:
                    has_children = True
                    visited[vertex] = True
                    subtree, distance = dfs(vertex)
                    total_subtree += subtree
                    total_distance += distance

            subtrees[root] = total_subtree
            if root == 0:
                distances[0] = total_distance

            if not has_children:
                return 1, 1
            else:
                return total_subtree + 1, total_distance + total_subtree + 1

        visited[0] = True
        dfs(0)

        # change root
        from collections import deque
        bfs = deque()
        visited = [False] * n
        bfs.append(0)
        visited[0] = True

        while bfs:
            node = bfs.popleft()
            for vertex in vertices[node]:
                if not visited[vertex]:
                    distances[vertex] = distances[node] + (n - subtrees[vertex] - 1) - (subtrees[vertex] + 1)
                    bfs.append(vertex)
                    visited[vertex] = True
        return distances


